import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import './playerInfo.css';

class PlayerInfo extends Component {
    render () {
        return (
            <div className="container">
                <Link to="/">
                    <img src='../../images/left-close.svg'/>
                </Link>
            </div>
        );
    }
}

export default PlayerInfo;
